    return <form>
    <H1></H1>
        {props.notes.map(e=>{
            {console.log("E.ID", e.content)}
            <ul>
                <li>
                    {e.content}
                </li>
                <br></br>
                <button onClick={()=> props.toggleImportanceOf(e.id)}>{e.important}</button>
                <br></br>
                <br></br>
            </ul>
    })}

    </form>
  }
